import React, { Component } from "react";
import Nav from "../Nav";
import image from "./images/oxfordgarden.jpg";

class About extends Component {
    render() {
        const divStyle = {
            color: "black",
            border: "2px white solid",
            borderRadius: "10px",
            background: "#ffffff80",
            fontFamily: "Arial, Helvetica, sans-serif",
            width: "50%",
            margin: "0 auto",
            display: "block",
            padding: "10px"
        }

        const titleStyle = {
            fontSize: "1.2rem",
            borderBottom: "1px black solid",
            width: "70%",
            marginBottom: "10px"
        }

        const imageStyle = {
            width: "300px",
            border: "2px white solid",
            display: "inline"
        }

        const textStyle = {
            display: "inline"
        }

        return (
            <div>
                <Nav />
                <div style={divStyle}>
                    <div id='about-title' style={titleStyle}>
                        About Me
                    </div>
                    <div id='about-body'>
                        <img style={imageStyle} src={image} alt="oxford gardens" />
                        <div id="about-text" style={textStyle}>
                            <p>I am a front-end web developer with a strong understanding of back-end frameworks. My background in graphic design, photography, and music allow me to find creative solutions to </p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default About;
